import React from 'react'
import './Table.css'

function Table({ number }) {



  const goToTable = () => {
		alert(`Table ${number} clicked`)
	};

  return (
    <div className="tables" onClick={goToTable}>
      <div className="tableCard">
        {`This is tableu number ${number}!!`}
      </div>
    </div>
  )
}

export default Table
